import React from 'react';
import { ExternalLink } from 'lucide-react';

const ProjectGrid = ({ projects, openProjectModal }) => {
  return (
    <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
      {projects.map((project) => (
        <div
          key={project.id}
          className="bg-gray-800 rounded-xl overflow-hidden shadow-lg hover:shadow-2xl transition-all duration-300 transform hover:-translate-y-1"
        >
          <div 
            className="h-48 bg-gray-700 overflow-hidden"
            onClick={() => openProjectModal(project)}
          >
            <img
              src={project.imageUrl}
              alt={project.title}
              className="w-full h-full object-cover transition-transform duration-300 hover:scale-110"
            />
          </div>
          <div className="p-6">
            <h3 className="text-xl font-bold mb-2 text-purple-300">{project.title}</h3>
            <p className="text-gray-400 text-sm mb-4 line-clamp-2">{project.description}</p>
            <div className="flex justify-between items-center">
              <button
                onClick={() => openProjectModal(project)}
                className="text-purple-400 hover:text-purple-300 transition-colors duration-300 flex items-center"
              >
                <ExternalLink size={18} className="mr-1" />
                View Details
              </button>
              {project.githubUrl && (
                <a
                  href={project.githubUrl}
                  target="_blank"
                  rel="noopener noreferrer"
                  className="text-gray-400 hover:text-white transition-colors duration-300"
                >

                </a>
              )}
            </div>
          </div>
        </div>
      ))}
    </div>
  );
};

export default ProjectGrid;
